CREATE TABLE Evento(
   ID_Evento  INTEGER  NOT NULL PRIMARY KEY 
  ,Esporte    VARCHAR(17) NOT NULL
  ,Disciplina VARCHAR(21) NOT NULL
  ,Nome       VARCHAR(35) NOT NULL
  ,Sexo       VARCHAR(6) NOT NULL
  ,Local      VARCHAR(112) NOT NULL
  ,CONSTRAINT fk_esporte_evento FOREIGN KEY (Esporte) REFERENCES Esporte(Nome)
);
